import React from 'react';
import ReactDOM from 'react-dom/client';

import App from './App';

import './styles/App.css';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <div className='background-setter'>
      <App />
    </div>
  </React.StrictMode>
);
